import axios from 'axios';

axios.defaults.baseURL = 'https://6d4f-2a05-9d41-75e-0-54fb-bf5-bfe3-5da9.ngrok-free.app';
axios.defaults.headers.common['ngrok-skip-browser-warning'] = 'any-value';
axios.defaults.headers.common['User-Agent'] = 'custom-agent/1.0'; // User-Agent personalizzato

// Aggiungi intercettori di richiesta per il debug
axios.interceptors.request.use(request => {
  console.log('Request:', request);
  return request;
}, error => {
  console.error('Request error:', error);
  return Promise.reject(error);
});

// Aggiungi intercettori di risposta per il debug
axios.interceptors.response.use(response => {
  console.log('Response:', response);
  return response;
}, error => {
  console.error('Response error:', error);
  return Promise.reject(error);
});

// Log per il debug
console.log('Axios Configured with baseURL:', axios.defaults.baseURL);
console.log('Axios Headers:', axios.defaults.headers);

export default axios;
